import React from "react";
import "./style.css";

function Filter() {
    return (
        <div class="tap-target" data-target="menu">
        <div class="tap-target-content">
          <h5>Title</h5>
          <p>A bunch of text</p>
        </div>
      </div>
    );
}

export default Filter;
